  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the Fiscal Year 2015
  operations budget with historical and proposed appropriations for state budgeted
  entities. The data is sortable by Budgeting for Results categories u201cStatewide
  Result Area,u201d and u201cStatewide Outcome Name.u201d The file is provided by
  the Governoru2019s Office of Management and Budget (website: Budget.Illinois.gov
  or http://www.state.il.us/budget/).nnThe first eight (8) Columns contain the statewide
  result area name, the statewide outcome area name, the agency name, the agency division
  name, the fund from which the appropriation is made, the appropriation name, the
  appropriation code associated with the appropriation, and the agency program name.nnThe
  remaining columns contain the appropriation amounts ($ thousands) for fiscal years
  2013 and 2014, and recommended and not recommended appropriations for fiscal year
  2015. Appropriations amounts for each fiscal year are broken out into General Funds
  (GF), Other State Funds (OF), and Federal Funds (FF).\",\n\t\"license_title\": \"License
